import './css/colors.css'
import './css/style.css'

import Navbar from './navbar'
import Load from './load'

import axios from 'axios'

function Home() {
    axios.get(localStorage.getItem('url') + '/about.json')
    .then(function (res) {
        console.log(res.data);

        const temp = document.getElementById('content')
        console.log(temp)
        // temp.innerHTML = res.data
    })
    .catch(function (err) {
        console.log(err)
    });

    return (
        <div className="App">
            <Navbar />
            <div id="content">
                <Load />
            </div>
        </div>
    );
}

export default Home
